package io.rezoome.external.mk.mapper;

import io.rezoome.manager.mapper.MapperEntity;

public class MkMapperEntity extends MapperEntity {

  private String userid;
  private String point0;
  private String point1;
  private String point2;
  private String point3;

  public String getUserid() {
    return userid;
  }

  public void setUserid(String userid) {
    this.userid = userid;
  }

  public String getPoint0() {
    return point0;
  }

  public void setPoint0(String point0) {
    this.point0 = point0;
  }

  public String getPoint1() {
    return point1;
  }

  public void setPoint1(String point1) {
    this.point1 = point1;
  }

  public String getPoint2() {
    return point2;
  }

  public void setPoint2(String point2) {
    this.point2 = point2;
  }

  public String getPoint3() {
    return point3;
  }

  public void setPoint3(String point3) {
    this.point3 = point3;
  }
}
